import React from 'react'
import styled from 'styled-components'

const Image = styled.div`
  background-color: white;
  height: 208px;
`

const SubTitle = styled.h2`
  font-size: 18px;
  margin: 0;
`

const Title = styled.h1`
  text-align: center;
  font-size: 24px;
  margin: 0;
`

const Container = styled.div`
  background-color: #010409;
  border: 0.5px solid #f2f2f2;
  box-sizing: border-box;
  border-radius: 8px;
  width: 224px;
  color: white;
  padding: 24px 16px;

  > * {
    margin-bottom: 8px;
  }
`

const Card = () => {
  return (
    <Container>
      <Title>EMF 5</Title>
      <Image />
      <Title>Espiritu</Title>
      <SubTitle>Fortalezas</SubTitle>
      <p>
        Puede volar, así que no tocará el suelo en la mayor parte de la partida.
        En algunos casos también traspasa las paredes.
      </p>
      <SubTitle>Debilidades</SubTitle>
      <p>La sal es un elemento que lo intoxica.</p>
    </Container>
  )
}

export default Card
